import React, { Component } from "react";


class File extends Component {
    //method
    method(name2) {
        return <h1>{name2}</h1>
    }
    render() {
        const name = "omar"
        const name2 = this.method("saade");
        return (
            <h1>{name}{name2}</h1>
        )
    }
}


export default File;
